  public function createorder()
  {
  
    $this->mailLog("createOrder start","");
    
    // Check shop / token
    $this->checkShopToken(true);
    
    if(in_array($this->shopID,array(1832,1981,4793,5117,8271))) {
        $cvr = intval(isset($_POST["cvr"]) ? trimgf(str_replace(array("_","-",".",",","-"),"",$_POST["cvr"])) : "");
        if($cvr <= 0 || strlen($cvr."") != 10) {
            return $this->outputServiceError(26,"Invalid company number");
        } else
        {
            $_POST["cvr"] = substr($cvr,0,6)."-".substr($cvr,6,4);
        }
    }
    
    // Create / find company
    $c = $this->createOrderCompany();
    
    // Check company id to make sure it is set
    if(!($c instanceof Company) || $c->id == 0)
    {
        return $this->outputServiceError(11,"Could not find or create company"); 
    }
    
    // Add company to shop
    try {
       $companyshop = new CompanyShop();
       $companyshop->company_id = $c->id;
       $companyshop->shop_id = $this->shop->id;
       $companyshop->save();
       } catch(Exception $e) {
    }
    
    // Setup companyorder
    $co = $this->createOrderSetupOrder($c);
    
    // Check data
    if($co->quantity <= 4) return $this->outputServiceError(15,"Invalid order information: quantity must be above 5");
    if($co->expire_date == "") return $this->outputServiceError(16,"Invalid order information: expire date missing"); 
    if($co->ship_to_address == "" || $co->ship_to_postal_code == "") return $this->outputServiceError(17,"Invalid order information:No company shipping information");
    if($co->contact_name == "" || $co->contact_email == "" || $co->contact_phone == "") return $this->outputServiceError(18,"Invalid order information:Contact information missing.");                                                                                 
    
    // Check expire date
    $expiredate = expireDate::getByExpireDate($co->expire_date);
    if(!$expiredate)  {
     return $this->outputServiceError(19,"Invalid expire date");
     } else {
       if($expiredate->blocked==1) return $this->outputServiceError(20,"Expire date is blocked");
     }
    

    try{
    
    // Find gift certificates
     if($co->is_email == 1) {
          $giftcertificates = GiftCertificate::findBatchEmail($this->shop->id,$co->quantity,$expiredate,$this->shop->reservation_group);
     }   else {
          $giftcertificates = GiftCertificate::findBatchPrint($this->shop->id,$co->quantity,$expiredate,$this->shop->reservation_group);
     }
    
    } catch (Exception $e)
    {                                                                            
     
      return $this->outputServiceError(21,"Could not allocate gift certificates ");
    }                                                                                                         
     if(count($giftcertificates) == 0) return $this->outputServiceError(21,"Could not allocate gift certificates (0 extracted)");
     
     // Set certificates
    $co->certificate_no_begin  =  $giftcertificates[0]->certificate_no;
    $co->certificate_no_end    =  $giftcertificates[countgf($giftcertificates)-1]->certificate_no;
    
    if((intval($co->certificate_no_end)-intval($co->certificate_no_begin)+1) != $co->quantity) {
        return $this->outputServiceError(21,"Could not allocate gift certificates (interval jump)");
    }
    
    // Save and check id
    $co->save();
    if($co->id == 0) return $this->outputServiceError(22,"Could not save order");
    
    // Add to shop
    foreach($giftcertificates as $giftcertificate)  {
      GiftCertificate::addToShop($giftcertificate->id,$this->shop->id,$c->id,$co->id);
      $expireDate = $giftcertificate->expire_date;
    }
    
    // Send gavekort e-mails
    if($co->is_email == 1)
    {
        $this->sendMailOrderEmail($co);
    }
    
    // Send confirmation email to contact
  	if(in_array($co->shop_id,array(272,57,58,59,574)))
  	{
  		$this->sendconfirmmailno($co->contact_name,$co->contact_email);
  	}
    else if(in_array($co->shop_id,array(1832,1981,4793,5117,8271)))
    {
      $this->sendconfirmmailse($co->contact_name,$co->contact_email);
    }
  	else
  	{
  		$this->sendconfirmmailda($co->contact_name,$co->contact_email);
  	}
    
    
     system::connection()->commit();
    
    // Return success
    $this->outputServiceSuccess(array("id" => $co->id));
    
  }
  
  
  
  
  private function createOrderCompany()
  {
    // Get company inputs
    $c = new Company();
    $c->name = $this->getInputString("companyname");
    $c->phone = $this->getInputString("phone"); 
    $c->website = $this->getInputString("website");
    $c->language_code = $this->getInputInt("language");
    $c->cvr = $this->getInputString("cvr");                                                   
    $c->ean = $this->getInputString("ean");
    $c->username = $this->getInputString("contact_email");
               
    $c->bill_to_address = $this->getInputString("bill_to_address");                                                      
    $c->bill_to_address_2 = $this->getInputString("bill_to_address_2");
    $c->bill_to_postal_code = $this->getInputString("bill_to_postal_code");
    $c->bill_to_city = $this->getInputString("bill_to_city");
    $c->bill_to_country = $this->getInputString("bill_to_country");
    $c->bill_to_email = $this->getInputString("bill_to_email");
    
    $c->ship_to_company = $this->getInputString("ship_to_company");
    $c->ship_to_address = $this->getInputString("ship_to_address");                                                      
    $c->ship_to_address_2 = $this->getInputString("ship_to_address_2");
    $c->ship_to_postal_code = $this->getInputString("ship_to_postal_code");
    $c->ship_to_city = $this->getInputString("ship_to_city");
    $c->ship_to_country = $this->getInputString("ship_to_country");
    
    if($c->ship_to_company == "") $c->ship_to_company = $c->name;
    if($c->ship_to_address == "") $c->bill_to_address = $c->bill_to_address;
    if($c->ship_to_address_2 == "") $c->bill_to_address_2 = $c->bill_to_address_2;
    if($c->ship_to_postal_code == "") $c->bill_to_postal_code = $c->bill_to_postal_code;
    if($c->ship_to_city == "") $c->bill_to_city = $c->bill_to_city;
    if($c->ship_to_country == "") $c->ship_to_country = $c->ship_to_country;
    
    $c->contact_name = $this->getInputString("contact_name");
    $c->contact_phone = $this->getInputString("contact_phone");
    $c->contact_email = $this->getInputString("contact_email");
    
    // Set default company
    $c->so_no = "";
    $c->sales_person = "";
    $c->gift_responsible = "";
    $c->footer = "";
    $c->logo = "";
    $c->password = $this->createOrderPasswordGenerate(8);
    $c->active = 1;
    $c->deleted = 0;
    $c->pick_group = "";
    $c->is_gift_certificate = 1;
    $c->address_updated = 0;
    $c->internal_note = "";
    $c->rapport_note = "";
    
    // Search for existing company
    $companyMatch = Company::find('all', array('conditions' => array('((cvr != "" and cvr is not null and cvr like ?) OR (ean != "" and ean is not null and ean like ?)) and active = 1 and deleted = 0 and ship_to_postal_code LIKE ? and is_gift_certificate = 1 and ship_to_address LIKE ?', $c->cvr,$c->ean,$c->ship_to_postal_code,$c->ship_to_address)));
    
    // Validate company and save new company
    if(count($companyMatch) == 0)
    {
      if($c->name == "") return $this->outputServiceError(10,"No company name");
      if($c->cvr == "") return $this->outputServiceError(11,"No company cvr");
      if($c->bill_to_address == "" || $c->bill_to_postal_code == "") return $this->outputServiceError(12,"No company billing information"); 
      if($c->contact_name == "" || $c->contact_email == "" || $c->contact_phone == "") return $this->outputServiceError(14,"Contact information missing.");
      
        // Reformat zip code
        if(in_array($this->shopID,array(1832,1981,4793,5117,8271))) {

            $c->bill_to_postal_code = str_replace(" ","",trimgf($c->bill_to_postal_code));
            if(strlen($c->bill_to_postal_code) == 5) {
                $c->bill_to_postal_code = substr($c->bill_to_postal_code,0,3)." ".substr($c->bill_to_postal_code,3);
            }
            
            $c->ship_to_postal_code = str_replace(" ","",trimgf($c->ship_to_postal_code));
            if(strlen($c->ship_to_postal_code) == 5) {
                $c->ship_to_postal_code = substr($c->ship_to_postal_code,0,3)." ".substr($c->ship_to_postal_code,3);
            }
            
        }
        
      $c->save();
    }
    else 
    {
      $c = $companyMatch[0];
    }
    
    return $c;
  
  }
  
  public static function createOrderPasswordGenerate($length=8)
	{
		// Variable til adgangskode
		$passstring = "1234567890qwertyuiopasdfghjklzxcvbnmQWERTYUIOPASDFGHJKLZXCVBNM123456789";
		$pass = "";
		
		// Generer adgangskode
		for($i=0;$i<intval($length);$i++)
			$pass .= $passstring[rand(0,(strlen($passstring)-1))];	
		
		// Returner adgangskode
		return $pass;
	}
  
  private function createOrderSetupOrder($c)
  {
    
    // Create order
    $co = new CompanyOrder();
    
    $co->quantity = $this->getInputInt("quantity");
    $co->expire_date = $this->getInputString("expire_date");    
    $co->is_email = $this->getInputInt("is_email") == 1 ? 1 : 0;
                         
    $co->ship_to_company = $this->getInputString("ship_to_company");
    $co->ship_to_address = $this->getInputString("ship_to_address");                                                      
    $co->ship_to_address_2 = $this->getInputString("ship_to_address_2");
    $co->ship_to_postal_code = $this->getInputString("ship_to_postal_code");
    $co->ship_to_city = $this->getInputString("ship_to_city");
    
    if($co->ship_to_company == "") $co->ship_to_company = $this->getInputString("companyname");
    if($co->ship_to_address == "")$co->ship_to_address = $this->getInputString("bill_to_address");                                                      
    if($co->ship_to_address_2 == "") $co->ship_to_address_2 = $this->getInputString("bill_to_address_2");
    if($co->ship_to_postal_code == "") $co->ship_to_postal_code = $this->getInputString("bill_to_postal_code");
    if($co->ship_to_city == "")$co->ship_to_city = $this->getInputString("bill_to_city");
  
    // Reformat zip code
      if(in_array($this->shopID,array(1832,1981,4793,5117,8271))) {
          
          $co->ship_to_postal_code = str_replace(" ","",trimgf($co->ship_to_postal_code));
          if(strlen($co->ship_to_postal_code) == 5) {
              $co->ship_to_postal_code = substr($co->ship_to_postal_code,0,3)." ".substr($co->ship_to_postal_code,3);
          }

      }
      
    $co->contact_name = $this->getInputString("contact_name");
    $co->contact_phone = $this->getInputString("contact_phone");
    $co->contact_email = $this->getInputString("contact_email");
       
    $co->giftwrap = $this->getInputInt("giftwrap") == 1 ? 1 : 0;
