    $co->is_printed = 0;
    $co->is_shipped = 0;
    $co->is_invoiced = 0;
    $co->spdeal = "";
    $co->spdealtxt = "";
    $co->is_cancelled = 0;
    $co->is_appendix_order = 0;
    $co->freight_calculated = 0;
