    public function getShopLink()
    {
        $shopID = $this->getInputString("shop_id");
        $token = $this->getInputString("access-token");

        if(is_int($shopID) || empty($token)){
            return $this->outputServiceError(7,'Invalid access-token');
            exit;
        }
        $shop = Shop::find($shopID);
        $link = $shop->link;
        $localisation = $shop->localisation;
        if(empty($link)){
            return $this->outputServiceError(7,'Invalid access-token');
            exit;
        }
        return $this->outputServiceSuccess(array("token" => $token,"localisation"=>$localisation,"shop" => $shopID,"link"=> $link));

    }
    public function shoplogin()
    {

      $this->checkShopToken(false);

      // Get inputs
      $username = $this->getInputString("username");
      $password = $this->getInputString("password");

      // Check shops
      if(!isset($_POST["shops"]) || !is_array($_POST["shops"])) return $this->outputServiceError(39,"Not locked to shop!");

      // Add shop id's
      $shops = array();
      foreach($_POST["shops"] as $shop) {
        if(intval($shop) > 0) {
            if(!in_array(intval($shop),$shops)) {
                $shops[] = intval($shop);
            }
        } else if(trim($shop) == "cardshop") {
            $cardshops = CardshopSettings::find('all');
            foreach($cardshops as $cardshop) {
                if(!in_array(intval($cardshop->shop_id),$shops)) {
                    $shops[] = intval($cardshop->shop_id);
                }
            }
        }
      }

      // No shops
      if(count($shops) == 0) {
          return $this->outputServiceError(39,"Not locked to shop.");
      }
  
      // Check inputs
      if($username == "" || $password == "") {
          return $this->outputServiceError(40,"Username or password missing");
      }


      ////////////// NEW SHOPUSER LOGIN PROCEDURE BEGIN /////////////////////

        $loginModel = new \GFBiz\Gavevalg\ShopUserLogin();
        $loginModel->lockToShopIDList($shops);

        $loginModel->loginWithUsernamePassword($username,$password);
        if($loginModel->isLoginValid()) {

            $token = $loginModel->createToken();

            $shopUser = $loginModel->getShopUser();
            ActionLog::logShopUserAction("ShopUserLogin", $shopUser->username." er logget ind","",$shopUser);

            system::connection()->commit();

            return $this->outputServiceSuccess(array("token" => $token,"shop" => $loginModel->getShopUser()->shop_id,"design" => $loginModel->getShop()->login_design));

        } else {
            return $this->outputServiceError($loginModel->getErrorCode(),$loginModel->getErrorMessage());
        }

    }
    
